- `condici√≥n`: Se eval√∫a antes de cada iteraci√≥n del bucle. Si la condici√≥n es verdadera, se ejecuta el c√≥digo dentro del bucle. Si la condici√≥n es falsa, el bucle termina.
- `actualizaci√≥n`: Se ejecuta al final de cada iteraci√≥n del bucle, para actualizar las variables de control.

